Future _mm_set_keyopt(db, value,int COMP,int STRE,int MACNO) async {
  String insert_field_set = 'ref_fnc_cd, kopt_cd, kopt_name, kopt_dsp_cond, kopt_inp_cond, kopt_limit_max, kopt_limit_min, kopt_digits, kopt_zero_typ, kopt_btn_color, kopt_info_comment, kopt_info_pic';
  String insert_field_sub = 'ref_fnc_cd, kopt_cd, koptsub_ordr, koptsub_data, fnc_cd, koptsub_comment, koptsub_btn_color';
  String cmn_set = 'CURRENT_TIMESTAMP, CURRENT_TIMESTAMP, \'0\', \'0\', \'999999\', \'2\'';
  String sub_query_1 = 'SELECT * FROM c_keyopt_set_mst WHERE ref_fnc_cd ';
  String sub_query_2 = 'SELECT * FROM c_keyopt_sub_mst WHERE ref_fnc_cd ';

  //-- taxfree_amt --
  await db.execute('''INSERT INTO c_keyopt_set_mst ($insert_field_set) SELECT '13', '1', \'免税下限対象額\n０～９９９９９９９　（０設定時は動作しない）', '1', '0', '999999999', '0', '9', '0', '5', \'免税宣言時に、免税処理を有効と\nするための下限額です。※1\n（初期値:5001）\n\n初期値の場合、\n税抜合計が5000円以下の場合は\n下限額未満の警告を表示します。\n\nその際、下限額未満でも強制的に\n免税することもできます。※2@p@\n※1．\n免税下減額（2015年現在）\n同一の非居住者に対し、\n同一店舗において、\n消耗品　：5千円を越え50万円まで\n一般物品：1万円を越えるもの\n\n※2．\n免税取引が成立している非居住者\nが追加取引を行う場合に限る', '0' WHERE NOT EXISTS ($sub_query_1 = '13' AND kopt_cd = '1');''');
//
//-- ttlamt_read --
  await db.execute('''INSERT INTO c_keyopt_set_mst ($insert_field_set) SELECT '13', '2', \'合計金額の読み上げ', '0', '1', '0', '0', '0', '0', '5', \'セルフレジで\n合計金額を読み上げることが\nできます。@p@\nしない：\n合計金額の読み上げを\nしません。\n\nする：\n合計金額を読み上げます。', '0' WHERE NOT EXISTS ($sub_query_1 = '13' AND kopt_cd = '2');''');
  await db.execute('''INSERT INTO c_keyopt_sub_mst ($insert_field_sub) SELECT '13', '2', '1', '0', '0', \'する', '5' WHERE NOT EXISTS ($sub_query_2 = '13' AND kopt_cd = '2' AND koptsub_ordr = '1');''');
  await db.execute('''INSERT INTO c_keyopt_sub_mst ($insert_field_sub) SELECT '13', '2', '2', '1', '0', \'しない', '5' WHERE NOT EXISTS ($sub_query_2 = '13' AND kopt_cd = '2' AND koptsub_ordr = '2');''');
